        private BigFloat BuildNumber(BigConstantInfo c)
        {
            return c.TryGetAsBigFloat(out BigFloat res, requestedAccuracyInBits, cutOnTrailingZero)
                ? res
                : onInsufficientBitsThenSetToZero ? default : BigFloat.Parse(c.ConstantAsString);
        }

        /// <summary>
        /// Mathematically calculates pi.
        /// </summary>
        public static BigFloat GeneratePi(int accuracyInBits = 2000)
        {
            BigInteger m = BigInteger.One << (accuracyInBits + ExtraHiddenBits + 12);
            BigInteger p = 125;
            BigInteger q = (239 * 239 * 239) << 2;
            BigInteger sum = (m / 5) - (m / (239 << 2));

            for (int j = 3; ; j += 4)
            {
                BigInteger t = m / j;
                BigInteger res =
                    +(m / (p * 25 * (j + 2)))
                    - (m / (q * ((57121 * j) + 114242)))
                    + (t / q)
                    - (t / p);

                if (res == 0)
                {
                    break;
                }

                sum += res;

                p *= 625;
                q *= 3262808641;
            }

            // Ensure last bits are correct.
            // Optional since ExtraHiddenBits area not considered exact.
            sum >>= 8;

            return new BigFloat(sum, 2 - (int)sum.GetBitLength() + ExtraHiddenBits, true);
        }
    }

