    public readonly struct BigConstantInfo
    {
        /// <summary>
        /// The name of the constant. (Example: Pi, Fine-Structure Constant, Phi)
        /// </summary>
        public readonly string Name;
        /// <summary>
        /// A formula that can generate this. Example: 
        /// </summary>
        public readonly string Formula;
        /// <summary>
        /// Provides a URL/Link to more info on the number.
        /// </summary>
        public readonly string MoreInfoURL;
        /// <summary>
        /// Provides a URL/Link the location of the digits.
        /// </summary>
        public readonly string SourceOfDigitsURL;
        /// <summary>
        /// Provides a the Person or sites name that generated the list.
        /// </summary>
        public readonly string SourceOfDigitsName;
        /// <summary>
        /// The number of decimal places provided in the code.
        /// </summary>
        public readonly int SizeHere;
        /// <summary>
        /// Contains the constant in string format. (up to 5000 digits)
        /// </summary>
        public readonly string ConstantAsString;
        /// <summary>
        /// The number of decimal placed available in the external file, if available, for numbers over 5000 digits.
        /// </summary>
        public readonly int SizeInFile;

        public BigConstantInfo(string name, string formula, string moreInfoLink, string sourceOfDigitsURL, string sourceOfDigitsName, int sizeHere, string numberWithMax5kDigits, int sizeInFile)
        {
            Name = name;
            Formula = formula;
            //MoreInfoURL = moreInfoURL;
            SourceOfDigitsURL = sourceOfDigitsURL;
            SourceOfDigitsName = sourceOfDigitsName;
            SizeHere = sizeHere;
            ConstantAsString = numberWithMax5kDigits;
            SizeInFile = sizeInFile;
        }

        /// <summary>
        /// Returns the number of decimal digits. 
        /// e.g. 12.3 is 3
        /// </summary>
        public int GetDecimalPrecision()
        {
            int counter = 0;

            if (ConstantAsString[counter] == '0')
            {
                counter++;
                if (ConstantAsString[counter] != '.')
                {
                    throw new ArgumentException("Not Supported");
                }

                while (ConstantAsString[counter + 1] == '0')
                {
                    counter++;
                }
            }

            return ConstantAsString.Length - counter - 1;
        }

        /// <summary>
        /// Gets the accuracy, or the number of digits after the decimal point. 
        /// e.g. 12.345 is 3
        /// </summary>
        public int GetDecimalAccuracy()
        {
            int len = ConstantAsString.Length;
            int locOfRadix = ConstantAsString.IndexOf('.');

            // if no radix point is found, it is an integer with an accuracy of 0.
            if (locOfRadix == -1)
            {
                return 0;
            }

            // Get the length minus the location of radix point.
            return len - locOfRadix - 1;
        }

        ///// <summary> 
        ///// Gets the approximate binary accuracy or the number of binary digits after the radix point. 
        ///// e.g. 10.111 is 5
        ///// This method has slow performance.
        ///// </summary>
        //public int GetBinaryAccuracyUNTESTED() => BigFloat.Parse(ConstantAsString).GetAccuracy;
        ////      =>  (int)(GetDecimalAccuracyUNTESTED() * 3.3219280948873623); // fast but approximate version

        ///// <summary>
        ///// Gets the approximate accuracy or the number of decimal places available. 
        ///// e.g. 11.1 is 1
        ///// This method has slow performance.
        ///// </summary>
        //public int GetBinaryPrecisionUNTESTED() => BigFloat.Parse(ConstantAsString).GetPrecision;
        ////      => (int)((trimmed.Length - 6) * 3.3219280948873623) + int.Log2(int.Parse(trimmed[..6])) + 2; // fast but approximate version

        /// <summary>
        /// Returns a common constant as a BigFloat with the given accuracy. The accuracy bits will stop on the first 0 after the <paramref name="targetAccuracyInBits"/>.
        /// e.g. 110.110110 with a <paramref name="targetAccuracyInBits"/> of 4 and <paramref name="cutOnTrailingZero"/>=true returns 110.11011
        /// e.g. 110.110100 with a <paramref name="targetAccuracyInBits"/> of 4 and <paramref name="cutOnTrailingZero"/>=true returns 110.1101
        /// e.g. 110.111000 with a <paramref name="targetAccuracyInBits"/> of 4 and <paramref name="cutOnTrailingZero"/>=true returns 110.1110
        /// </summary>
        /// <param name="value">The BigFloat to return.</param>
        /// <param name="targetAccuracyInBits">The target binary accuracy that should be fetched. The result will be this size or larger.</param>
        /// <param name="cutOnTrailingZero">Cuts off the accuracy just prior to a zero trailing bit. This ensures the result would be the same even if rounded.</param>
        /// <returns>Returns true if successful.</returns>
        public bool TryGetAsBigFloat(out BigFloat value, int targetAccuracyInBits, bool cutOnTrailingZero = true)
        {
            int approximateBinaryAccuracy = (int)(GetDecimalAccuracy() * 3.3219280948873623);
            int requestedAccuracyInDecDigits = (int)((targetAccuracyInBits + ExtraHiddenBits) / 3.3219280948873623);
            int decDigitsNeeded = requestedAccuracyInDecDigits + ConstantAsString.IndexOf('.');

            if (approximateBinaryAccuracy >= targetAccuracyInBits)
            {
                // if the size is met by the internal code then lets use that.
                value = BigFloat.Parse(ConstantAsString[..decDigitsNeeded]);
            }
            else
            {
                // The build in constant in the code was not long enough. Let check to see if the constant exists in an external text resource file.
                string fileToTryAndLoad = $"Values\\{ConstantAsString[..14]}.txt";
                if (File.Exists(fileToTryAndLoad))
                {
                    string filesText = File.ReadAllText(fileToTryAndLoad);
                    Match m = Regex.Match(filesText, @"(?<=Number: )(\d+\.\d{" + requestedAccuracyInDecDigits + "})", RegexOptions.IgnoreCase);
                    if (m.Success)
                    {
                        value = BigFloat.Parse(m.Value);
                    }
                    else
                    {
                        //throw new Exception("Error reading constant value file from 'Values' folder.");
                        value = default;
                        return false;
                    }
                }
                else
                {
                    //throw new Exception("The requested accuracy is not available.");
                    value = default;
                    return false;
                }
            }

            int overAccurateBy = -value.Scale - targetAccuracyInBits;
            if (overAccurateBy < 0)
            {
                value = default;
                return false;
                //throw new Exception("The requested accuracy is too high.");
            }

            // if user does not want to cut just before a zero bit then lets return.
            if (!cutOnTrailingZero)
            {
                value = TruncateByAndRound(value, overAccurateBy);
                return true;
            }

            // Lets find the nearest 0 bit above the "bits" param and return that without the 0.
            // The reason we want to do this is the result would be the same even if rounded.
            // Lets first start with the requested accuracy and work to the right(more accurate) and stop at the first zero.
            for (int i = overAccurateBy; i >= 0; i--)
            {
                if ((value.DataBits >> (i - 1)).IsEven)
                {
                    // no rounding needed since top removed bit is 0
                    value = ReducePrecision(value, i);
                    return true;
                }
            }

            // okay, we search to the end but did not find any zeros, lets search going forward instead.
            for (int i = overAccurateBy + 1; i < 32; i++)
            {
                if ((value.DataBits >> i).IsEven)
                {
                    _ = ReducePrecision(value, i);
                    return true;
                }
            }

            //throw new Exception($"Unable to find zero bit in last {overAccurateBy+ExtraHiddenBits} bits.");
            value = default;
            return false;
        }
    }

}